import React, {useEffect, useState} from "react";
export const Home = (props) => {
    return (
        <div>
            <div className="row mx-0" style={{height:700+"px"}}>
                <div className="col-3 bg-primary">
                    &nbsp;
                </div>
                <div className="col-7 bg-secondary">
                    &nbsp;
                </div>
                <div className="col-2 bg-danger">
                    &nbsp;
                </div>
            </div>
        </div>
    )
}
